import React from 'react';
import Container, { Grid } from '@mui/material'
import './css/MainPage.css';
function MainPage() {
    const tempData = [
        {
            id: 1,
            title: title1,
            content: data1
        },
        {
            id: 2,
            title: title2,
            content: data2
        },
        {
            id: 3,
            title: title3,
            content: data3
        },
    ];

  return (
    <>
        <Grid container spacing={2}></Grid>
    </>
  );
}

export default MainPage;
